import "./css/banner.css"
import Banner_Circle_Animation from "./banner_circle_animation"
function Banner() {
    return (
        <div id = "banner">
            <p>
                CHAT APP
            </p>
            <div>
                <Banner_Circle_Animation />
            </div>
        </div>
    )
}
export {Banner}
